import './digital_marketing';

const DigitalMarketing = () =>{
    return(
        <>
        <div className="container">
            <div className="marketing_title">
                <span style={{fontWeight:300}}>Digital <span style={{fontWeight:800}}>Marketing</span></span>
            </div>
        </div>

        </>
    )
}
export default DigitalMarketing ;
